import React from "react";

function OurServicesBoxes() {
  return (
    <div className="container">
      <div className="ourServicesBoxes">
        <div className="ourServicesBox"></div>
        <div className="ourServicesBox"></div>
        <div className="ourServicesBox"></div>
        <div className="ourServicesBox"></div>
      </div>
    </div>
  );
}

export default OurServicesBoxes;
